setLazyTranslations(
  "vi",
  "course_wizard",
  function() { return {"add_course_assignments_628ed6d0":"Thêm Bài Tập Khóa Học","add_course_calendar_events_146154a5":"Thêm Sự Kiện Lịch Khóa Học","add_files_to_the_course_da6ffd32":"Thêm Tệp vào Khóa Học","add_students_to_the_course_874be8fb":"Thêm Sinh Viên vào Khóa Học","add_tas_to_the_course_2aac6e02":"Thêm các trợ giảng vào các Khóa Học","add_your_assignments_you_can_just_make_a_long_list_8a7862dd":"Thêm các bài tập của bạn.  Bạn chỉ có thể tạo một danh sách dài hoặc chia chúng thành các nhóm - và thậm chí chỉ định trọng số cho từng nhóm bài tập.","all_finished_time_to_publish_your_course_click_the_b6f07217":"Tất cả đã hoàn thành?  Đã đến lúc công bố khóa học của bạn!  Nhấp vào nút bên dưới để chính thức công bố! Việc công bố sẽ cho phép người dùng bắt đầu tham gia khóa học.","by_default_all_links_are_enabled_for_a_course_stud_8e617dbc":"Theo mặc định, tất cả các liên kết được bật cho một khóa học.  Sinh viên sẽ không thấy liên kết đến các phần không có nội dung.  Ví dụ: nếu bạn chưa tạo bất kỳ câu hỏi kiểm tra nào, họ sẽ không nhìn thấy liên kết câu hỏi kiểm tra.  Bạn có thể sắp xếp và tắt dứt khoát các liên kết này nếu có những phần trong khóa học mà bạn không muốn sinh viên của mình truy cập.","choose_a_course_home_page_8059c7b":"Chọn một Trang Chủ Của Khóa Học","close_and_return_to_canvas_80544344":"Đóng và quay lại Canvas","course_setup_wizard_is_showing_a7c087c1":"Trình Hướng Dẫn Thiết Lập Khóa Học đang hiển thị.","course_wizard_31c87552":"Trình Khóa Học","great_so_you_ve_got_a_course_now_what_well_before__38cfba67":"Tuyệt vời, vậy là bạn đã có một khóa học. Giờ thì sao? Chà, trước khi công bố cho cả thế giới, bạn có thể muốn kiểm tra và đảm bảo rằng bạn đã nắm được những kiến ​​thức cơ bản.  Xem qua danh sách bên trái để đảm bảo rằng khóa học của bạn đã sẵn sàng để sử dụng.","here_s_a_great_chance_to_get_to_know_the_calendar__187ce49":"Đây là cơ hội tuyệt vời để tìm hiểu lịch và thêm bất kỳ sự kiện không phải bài tập mà bạn có thể có vào khóa học. Đừng lo lắng, chúng tôi sẽ giúp bạn vượt qua.","if_you_ve_been_using_another_course_management_sys_67edfab1":"Nếu bạn đang sử dụng một hệ thống quản lý khóa học khác, bạn có thể có những thứ trong đó mà bạn sẽ muốn chuyển sang Canvas. Chúng tôi có thể hướng dẫn bạn quy trình di chuyển dễ dàng nội dung của bạn vào Canvas.","import_content_b2fd6620":"Nhập Nội Dung","item_complete_d334fd43":"(Mục Hoàn Thành)","item_incomplete_d6a16040":"(Mục Chưa Hoàn Thành)","loaded_more_collaborations_13f1d630":"Đã Tải Thêm Các Cộng Tác.","my_dashboard_b724020":"Bảng điều khiển của tôi","next_steps_ce0f0d0c":"Bước Tiếp Theo","now_that_your_course_is_set_up_and_available_you_p_c0c8635c":"Bây giờ khóa học của bạn đã được thiết lập và khả dụng, bạn có thể sẽ không cần danh sách kiểm tra này nữa. Nhưng chúng tôi sẽ giữ lại danh sách đề phòng về sau bạn muốn thử điều gì đó mới hoặc cần thêm một chút sự trợ giúp khi bạn thay đổi nội dung khóa học.","publish_the_course_f2f6ef80":"Công Bố Khóa Học","select_navigation_links_68e1e924":"Chọn Các Liên Kết Điều Hướng","setup_checklist_eb8b00b8":"Danh Sách Kiểm Tra Thiết Lập","the_files_tab_is_the_place_to_share_lecture_slides_95a93bce":"Tab Tập Tin là nơi để chia sẻ các slide bài giảng, tài liệu mẫu, hỗ trợ nghiên cứu -- bất kỳ thứ gì mà sinh viên của bạn muốn tải xuống.  Tải lên và sắp xếp các tập tin của mình dễ dàng bằng Canvas.  Chúng tôi sẽ chỉ cho bạn cách làm.","this_course_is_claimed_and_ready_but_you_ll_need_t_25b95a0a":"Khóa học này đã được xác nhận quyền sở hữu và đã sẵn sàng, nhưng bạn sẽ cần hoàn tất quá trình đăng ký trước khi có thể công bố khóa học.  Bạn hẳn đã nhận được email từ Canvas có liên kết để kết thúc quá trình.  Đừng quên kiểm tra hộp thư rác.","this_course_is_visible_only_to_teachers_until_it_i_ce972f0":"Khóa học này chỉ hiển thị với giáo viên cho đến khi được công bố.","when_people_visit_the_course_this_is_the_page_they_de94acc2":"Khi mọi người truy cập khóa học, đây là trang họ sẽ nhìn thấy.  Bạn có thể cài đặt để hiển thị luồng hoạt động, danh sách học phần khóa học, chương trình học hoặc một trang tùy chỉnh do bạn tự cài đặt.  Chế độ mặc định là luồng hoạt động khóa học.","you_do_not_have_permission_to_publish_this_course_ff361c82":"Bạn không có quyền công bố khóa học này.","you_ll_definitely_want_some_of_these_what_s_the_fu_f4f3578b":"Bạn chắc chắn sẽ muốn một vài thứ trong này.  Khi đang dạy một khóa học mà không có ai thèm nghe giảng thì vui vẻ gì?","you_may_want_to_assign_some_tas_to_help_you_with_t_702244aa":"Bạn có thể muốn chỉ định một số trợ giảng để hỗ trợ khóa học này.  Các trợ giảng có thể chấm điểm các bài nộp của sinh viên, hỗ trợ kiểm duyệt thảo luận và thậm chí có thể cập nhật ngày hết hạn và thông tin chi tiết bài tập giúp bạn."} },
  null
)


